CREATE TABLE dre (
iddre smallint(4) NOT NULL AUTO_INCREMENT,
codigo_dre varchar(4) NOT NULL,
nombre varchar(30) NOT NULL,
codigo_region varchar(2) NOT NULL,
activo char(1) DEFAULT '1',
PRIMARY KEY (iddre)) ENGINE = InnoDB CHARACTER SET = utf8 COLLATE = utf8_general_ci;


CREATE TABLE ugel (
idugel smallint(4) NOT NULL AUTO_INCREMENT,
iddre smallint(4) NOT NULL,
codigo_ugel varchar(6) NOT NULL,
nombre varchar(30) NOT NULL,
activo char(1) DEFAULT '1',
PRIMARY KEY (idugel),
FOREIGN KEY (iddre) REFERENCES dre (iddre) ON DELETE CASCADE ON UPDATE CASCADE
) ENGINE = InnoDB CHARACTER SET = utf8 COLLATE = utf8_general_ci;


CREATE TABLE perfil  (
idperfil smallint(4) NOT NULL AUTO_INCREMENT,
perfil varchar(50) NOT NULL,
activo char(1) DEFAULT '1',
PRIMARY KEY (idperfil)) ENGINE = InnoDB CHARACTER SET = utf8 COLLATE = utf8_general_ci;


CREATE TABLE ubigeo(
	idubigeo smallint(4) NOT NULL AUTO_INCREMENT,
	ubigeo varchar(6),
	departamento varchar(50),
	provincia varchar(50),
	distrito varchar(50),
	latitud varchar(50),
	longitud varchar(50),
	cod_dep varchar(2),
	cod_pro varchar(2),
	cod_dis varchar(2),
	activo Char(1) DEFAULT '1',
	PRIMARY KEY (idubigeo)) ENGINE = InnoDB CHARACTER SET = utf8 COLLATE = utf8_general_ci;
	

CREATE VIEW lista_ubigeo
As
Select ubigeo,departamento,provincia,distrito,CONCAT_WS(' - ',departamento,provincia,distrito)  As 'descripcion',latitud, longitud From ubigeo;

CREATE TABLE usuarios  (
  idusuario smallint(4) NOT NULL AUTO_INCREMENT,
  tipo_dni smallint(4) default 1,
  dni varchar(9) NOT NULL,
  avatar varchar(30),
  apellidos varchar(50) NOT NULL,
  nombres varchar(50) NOT NULL,
  usuario varchar(50) NOT NULL,
  passwd varchar(50) NOT NULL,
  idperfil smallint(4) NOT NULL,
  activo char(1) DEFAULT '1',
  PRIMARY KEY (idusuario),
	FOREIGN KEY (idperfil) REFERENCES perfil (idperfil) ON DELETE CASCADE ON UPDATE CASCADE
) ENGINE = InnoDB CHARACTER SET = utf8 COLLATE = utf8_general_ci;


CREATE TABLE usuarios_dre  (
	idusuariodre smallint(4) NOT NULL AUTO_INCREMENT,
